import { useParams, Link } from "react-router-dom";
export default function QuoteDetail() {
  const param = useParams();
  return (
    <div>
      {" "}
      <h2>Quote Detail Page</h2>
      <p>{param.quoteId}</p>
      <Link to={`/e`}>OK</Link>
    </div>
  );
}
